import React from 'react';
import { Link } from 'react-router-dom';

export default function LandingPage(){
  return (
    <div>
      <h1>Bienvenidos todos a la pokemon web!</h1>
      <Link to= '/home'>
      <button>Ingresar</button>
      </Link>
    </div>
  )
}
